class sqlUnloadRecord:
    """
    SQL Record container Class
    """
    def __init__(self,conn,stmt,file,tmstfmt,datefmt,timefmt):
        self.conn = conn
        self.stmt = self.conn.createStatement()
        self.rs = self.stmt.executeQuery(stmt)
        self.file = open(file, "w")
        self.target_DT = [<%=odiRef.getColList("", "\u0022[DEST_DT]\u0022", ",", "", "")%>]

        self.tmstpfmt = txt.SimpleDateFormat(tmstfmt);
        self.datefmt = txt.SimpleDateFormat(datefmt);
        self.timefmt = txt.SimpleDateFormat(timefmt);
    def getDate(self,mydate,dt):
        if mydate == None: return ""
        if dt == 'TIME':
            return(self.timefmt.format(mydate))
        else:
            return(self.datefmt.format(mydate))

    def getTimestamp(self,mytimestamp,dt):
        if mytimestamp == None: return ""
        if dt == 'TIME':
            return(self.timefmt.format(mytimestamp))
        elif dt == 'DATE':
            return(self.datefmt.format(mytimestamp))
        else:
            return(self.tmstpfmt.format(mytimestamp))


    def getTime(self,mytime,dt):
        if mytime == None: return ""
        return(self.timefmt.format(mytime))


    def rsIterator(self):

        metaData = self.rs.metaData
        while self.rs.next():
            n=metaData.columnCount
            for i in range(n):
                exp = "%s" % self.getObject(metaData.getColumnName(i+1),metaData.getColumnType(i+1),self.target_DT[i])
                self.file.write(exp.encode('UTF-8') )
                if i+1< n : self.file.write("\t")
            self.file.write("\n")    

    def runQuery(self):
        """running the query.
        """
        self.rsIterator()
        self.stmt.close()
        self.file.close()
    def getObject(self,col,colType,colTypeDT):
            """write the record to the file.
            """


            if colType == sql.Types.VARCHAR:    return(self.rs.getString(col))    
            if colType == sql.Types.CHAR:       return(self.rs.getString(col))    
            if colType == sql.Types.INTEGER:    return(self.rs.getInt(col))    
            if colType == sql.Types.NUMERIC:    return(self.rs.getBigDecimal(col))    
            if colType == sql.Types.DECIMAL:    return(self.rs.getBigDecimal(col))    
            if colType == sql.Types.DATE:       return(self.getDate(self.rs.getDate(col),colTypeDT))    
            if colType == sql.Types.TIME:       return(self.getTime(self.rs.getTime(col),colTypeDT))   
            if colType == sql.Types.TIMESTAMP:  return(self.getTimestamp(self.rs.getTimestamp(col),colTypeDT))    
            if colType == sql.Types.BIGINT:     return(self.rs.getLong(col))    
            if colType == sql.Types.BINARY:     return(self.rs.getBytes(col))    
            if colType == sql.Types.BIT:        return(self.rs.getBoolean(col))    
            if colType == sql.Types.DOUBLE:     return(self.rs.getDouble(col))    
            if colType == sql.Types.LONGVARBINARY: return(self.rs.getBytes(col))    
            if colType == sql.Types.LONGVARCHAR:   return(self.rs.getString(col))    
            if colType == sql.Types.OTHER:         return(self.rs.getObject(col))    
            if colType == sql.Types.REAL:          return(self.rs.getFloat(col))    
            if colType == sql.Types.SMALLINT:      return(self.rs.getShort(col))    
            if colType == sql.Types.TINYINT:       return(self.rs.getByte(col))    
            if colType == sql.Types.VARBINARY:     return(self.rs.getBytes(col)) 

